export const PeticionPut = async (props) => {

    await fetch('/author',
        {
            method: "GET",
            mode: 'cors',
            headers: {

                'Access-Control-Allow-Origin': 'http://localhost:8080',

            }

        }).then(res => res.json())
        .catch(error => console.error('Error:', error))
        .then(response => console.log('Success:', response));
}
